import { ReactGoogleReviews, dangerouslyFetchPlaceReviews } from "react-google-reviews";
import "react-google-reviews/dist/index.css";

async function ReviewsPage() {
    const placeId = "ChIJl0Rtw56fFkcR9iJVhqb61rg"; // Replace with your actual Place ID
    const apiKey = "AIzaSyCV7mddTzz-yu_11-FZtxIim3iunxUiZdg"; // Replace with your actual API Key

    const reviews = await dangerouslyFetchPlaceReviews(placeId, apiKey);

    return (
        <ReactGoogleReviews reviews={reviews} layout="carousel" />
    );
}

export default ReviewsPage;
